import React from "react";
import Panel from "./panel";

const Dashboard = () => {
  return (
    <div className="container" style={{ height: "100%" }}>
      <div className="row no-gutters">
        <div
          className="p-2 col-lg-3 col-md-4 col-sm-6 col-10"
          style={{ height: "200px" }}
        >
          <div className="pnl convex"></div>
        </div>

        <div
          className="col-lg-2 col-md-4 col-sm-6 col-6"
          style={{ height: "200px" }}
        >
          <div className="row no-gutters h-100">
            <div className="col-md-12 h-30 p-2">
              <div className="convex pnl"></div>
            </div>
            <div className="col-md-12 h-70 p-2">
              <div clasName="concave pnl"></div>
            </div>
          </div>
        </div>

        <div
          className="col-lg-4 col-md-6 col-sm-6 col-6"
          style={{ height: "200px" }}
        >
          <div className="col-lg-4 col-md-6 col-sm-6 col-6"></div>
          <div className="col-lg-4 col-md-6 col-sm-6 col-6"></div>
          <div className="col-lg-4 col-md-6 col-sm-6 col-6"></div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
